const e=JSON.parse('{"key":"v-ef2f5c72","path":"/note/mysql/MySQL-Basic.html","title":"MySQL 基础笔记","lang":"zh-CN","frontmatter":{"description":"MySQL 基础笔记 MySQL-logo 1. 简介 MySQL是一种关系型数据库管理系统，由瑞典MySQL AB公司开发，属于Oracle旗下产品。MySQL将数据保存在不同的表中，而不是将所有数据放在一个大仓库内，这样就增加了速度并提高了灵活性。 MySQL所使用的 SQL 语言是用于访问数据库的最常用标准化语言。MySQL 软件采用了双授权政策，分为社区版和商业版，由于其体积小、速度快、总体拥有成本低，尤其是开放源码这一特点，一般中小型和大型网站的开发都选择 MySQL 作为网站数据库。","head":[["meta",{"property":"og:url","content":"https://JCven-chao.github.io/note/mysql/MySQL-Basic.html"}],["meta",{"property":"og:site_name","content":"JCvenBlog"}],["meta",{"property":"og:title","content":"MySQL 基础笔记"}],["meta",{"property":"og:description","content":"MySQL 基础笔记 MySQL-logo 1. 简介 MySQL是一种关系型数据库管理系统，由瑞典MySQL AB公司开发，属于Oracle旗下产品。MySQL将数据保存在不同的表中，而不是将所有数据放在一个大仓库内，这样就增加了速度并提高了灵活性。 MySQL所使用的 SQL 语言是用于访问数据库的最常用标准化语言。MySQL 软件采用了双授权政策，分为社区版和商业版，由于其体积小、速度快、总体拥有成本低，尤其是开放源码这一特点，一般中小型和大型网站的开发都选择 MySQL 作为网站数据库。"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:locale","content":"zh-CN"}],["meta",{"property":"article:author","content":"JCven"}],["script",{"type":"application/ld+json"},"{\\"@context\\":\\"https://schema.org\\",\\"@type\\":\\"Article\\",\\"headline\\":\\"MySQL 基础笔记\\",\\"image\\":[\\"\\"],\\"dateModified\\":null,\\"author\\":[{\\"@type\\":\\"Person\\",\\"name\\":\\"JCven\\",\\"url\\":\\"https://github.com/JCven-chao\\"}]}"]]},"headers":[{"level":3,"title":"1. 简介","slug":"_1-简介","link":"#_1-简介","children":[]},{"level":3,"title":"2. 常见命令","slug":"_2-常见命令","link":"#_2-常见命令","children":[]},{"level":3,"title":"3. 语法规则及分类","slug":"_3-语法规则及分类","link":"#_3-语法规则及分类","children":[]},{"level":3,"title":"4. 数据类型","slug":"_4-数据类型","link":"#_4-数据类型","children":[]},{"level":3,"title":"5. DDL数据定义语言","slug":"_5-ddl数据定义语言","link":"#_5-ddl数据定义语言","children":[]},{"level":3,"title":"6. DML数据操作语言","slug":"_6-dml数据操作语言","link":"#_6-dml数据操作语言","children":[]},{"level":3,"title":"7. DQL数据查询语言","slug":"_7-dql数据查询语言","link":"#_7-dql数据查询语言","children":[]},{"level":3,"title":"8. DCL数据控制语言","slug":"_8-dcl数据控制语言","link":"#_8-dcl数据控制语言","children":[]},{"level":3,"title":"9. 函数","slug":"_9-函数","link":"#_9-函数","children":[]},{"level":3,"title":"10. 约束","slug":"_10-约束","link":"#_10-约束","children":[]},{"level":3,"title":"11. 多表查询","slug":"_11-多表查询","link":"#_11-多表查询","children":[]},{"level":3,"title":"12. 事务","slug":"_12-事务","link":"#_12-事务","children":[]}],"git":{"createdTime":null,"updatedTime":null,"contributors":[]},"readingTime":{"minutes":16.49,"words":4948},"filePathRelative":"note/mysql/MySQL-Basic.md","excerpt":"<h1> MySQL 基础笔记</h1>\\n<figure><img src=\\"/assets/note-images/mysql/mysql-logo.png\\" alt=\\"MySQL-logo\\" tabindex=\\"0\\" loading=\\"lazy\\"><figcaption>MySQL-logo</figcaption></figure>\\n<h3> 1. 简介</h3>\\n<p>MySQL是一种关系型数据库管理系统，由瑞典MySQL AB公司开发，属于Oracle旗下产品。MySQL将数据保存在不同的表中，而不是将所有数据放在一个大仓库内，这样就增加了速度并提高了灵活性。</p>\\n<p>MySQL所使用的 SQL 语言是用于访问数据库的最常用标准化语言。MySQL 软件采用了双授权政策，分为社区版和商业版，由于其体积小、速度快、总体拥有成本低，尤其是开放源码这一特点，一般中小型和大型网站的开发都选择 MySQL 作为网站数据库。</p>","autoDesc":true}');export{e as data};
